import React from 'react';

function AddToCart({ cart, setCart, inputV }) {

    return (
        <div>
            <div>AddToCart - {inputV}</div>
            <button onClick={addItemToCart}>Add to Cart</button>
            <div>
                <h2>Cart Items:</h2>
                {cart.map(item => (
                    <div key={item.id}>{item.name}</div>
                ))}
            </div>
        </div>
    );
}

export default AddToCart;
